Data ini merupakan kumpulan data Kunjungan Kerja Kedinasan yang dilaksanakan oleh anggota DPRD dan Instansi pemerintahan lainnya di Biro Hukum Setda Provinsi DKI Jakarta pada tahun 2019.
Berikut penjelasan mengenai data ini:
1.Tanggal: tanggal saat kunjungan ke Biro Hukum;
2.Asal: nama/instansi mana tamu tersebut;
3.Jumlah: jumlah tamu dalam satu kali kunjungan;
4.Perihal: maksud dan tujuan dari kunjungan;
5.Pejabat Penerima: pegawai Biro Hukum yang menerima dan memberikan penjelasan terkait dari maksud dan kunjungan tamu.

Data Peraturan Gubernur Provinsi DKI Jakarta Tahun 2018
Data ini merupakan kumpulan produk hukum berupa Peraturan Gubernur Provinsi DKI Jakarta pada tahun 2018.
Berikut penjelasan mengenai data ini:
nomor_peraturan : Nomor Peraturan Gubernur berdasarkan urutan diterbitkan dalam tahun tersebut;
nama_peraturan_gubernur : Judul perihal isi Peraturan Gubernur;
tanggal_ditetapkan : Tanggal pada saat Peraturan Gubernur disahkan;
tanggal_diundangkan : tanggal berlakunya Peraturan Gubernur.;
tahun : tahun pembuatan Peraturan Gubernur;
nomor_berita_daerah : nomor Peraturan Gubernur dalam Berita Daerah.

Data Kelurahan Sadar Hukum
   Data ini berisi kumpulan data daftar nama kelurahan yang telah ditetapkan menjadi Kelurahan Sadar Hukum pada periode tahun tertentu berdasarkan Keputusan Gubernur.
Berikut keterangan mengenai data ini:
tahun, menunjukkan pada tahun kapan kelurahan tersebut menjadi Kelurahan Sadar Hukum;
wilayah, terdapat di wilayah kota/kabupaten mana kelurahan dimaksud;
kecamatan, lingkup kecamatan;
kelurahan, nama kelurahan yang menjadi Kelurahan Sadar Hukum pada tahun dimaksud;
keterangan, menerangkan dasar hukum ditetapkannya kelurahan menjadi Kelurahan Sadar Hukum.

Data ini merupakan kumpulan data Kunjungan Kerja Kedinasan yang dilaksanakan oleh anggota DPRD dan Instansi pemerintahan lainnya di Biro Hukum Setda Provinsi DKI Jakarta pada tahun 2018. Berikut penjelasan mengenai data ini:
1.Tanggal: tanggal saat kunjungan ke Biro Hukum;
   2.Asal: nama/instansi mana tamu tersebut; 
   3.Jumlah: jumlah tamu dalam satu kali kunjungan; 
   4.Perihal: maksud dan tujuan dari kunjungan; 
   5.Pejabat Penerima: pegawai Biro Hukum yang menerima dan memberikan penjelasan terkait dari maksud dan kunjungan tamu.

Data ini merupakan daftar kumpulan barang aset yang dimiliki oleh Biro Hukum Setda Provinsi DKI Jakarta
Berikut penjelasan mengenai data ini:
1.Kode Barang: kode barang sesuai Permendagri Nomor 17  Tahun 2007;
   2.Jenis Nama Barang: jenis barang atau nama barang;
   3.Merk: merk dari barang tersebut';
   4.Tipe: tipe atau model dari barang tersebut;
   5.Tahun Pembelian: tahun pada saaat barang tersebut dibeli;
   6.Jumlah Barang: jumlah keseluruhan pada satu jenis barang;
   7.Satuan: satuan barang tersebut;
   8. Asal: bagaimana barang tersebut diperoleh;
   9.Harga Rupiah: harga pada saat pembelian barang tersebut.

Dataset ini berisi mengenai rekap seluruh pelayanan perizinan dan non-perizinan yang telah dilaksanakan di Bulan Desember 2017 di Wilayah Kota Administrasi Jakarta Utara.
Penjelasan mengenai Variabel pada Dataset ini :
   bidang;
   sub_bidang;
   jenis perizinan dan non perizinan menurut Pergub 47/2017;
   jenis perizinan dan non perizinan menurut Pergub 7/2016;
   kewenangan_awal;
   kewenangan_baru;
   wilayah;
   bulan;
   jumlah;

