Data ini merupakan kumpulan produk hukum berupa Peraturan Gubernur pada tahun 2017.
Berikut penjelasan mengenai data ini:
   1. nomor_peraturan : Nomor Peraturan Gubernur berdasarkan urutan diterbitkan dalam tahun tersebut;
   2. nama_peraruran_gubernur : Judul perihal isi Peraturan Gubernur;
