Data ini merupakan kumpulan data Lembaga Bantuan Hukum hasil verifikasi Pelaksanaan Bantuan Hukum Provinsi DKI Jakarta bagi warga DKI Jakarta yang tidak mampu, berdasarkan Keputusan Menteri Hukum dan HAM RI.
   Berikut penjelasan mengenai data ini:
   Nama, nama LBH/OBH;
   Alamat, tempat LBH/OBH berada;
   Wilayah, lingkup daerah LBH/OBH;
   Akreditasi, peringkat prestasi yang didapat oleh LBH/OBH tersebut.

