Data ini mengenai Kegiatan Usaha yang Mengikuti PROPER di Provinsi DKI Jakarta pada Tahun 2016
Penjelasan variabel data terdiri dari :
Tanggal Pelaksanaan Mulai merupakan tanggal dimulainya pelaksanaan audit pelaksanaan PROPER;
Tanggal Pelaksanaan Hingga merupakan tanggal akhir pelaksanaan audit pelaksanaan PROPER;
Nama Perusahaan adalah nama perusahaan yang dilakukan audit untuk kegiatan PROPER;
Jenis Kegiatan adalah jenis kegiatan dari perusahaan yang dilakukan audit untuk kegiatan PROPER;
Evaluator adalah nama badan pemerintah yang melakukan evaluasi terhadapt audit PROPER;
Wilayah adalah alamat perusahaan tersebut berada di wilayah mana;
Hasil Peringkat adalah hasil akhir penilaian PROPER terhadap perusahaan tersebut;

